(52, '2014-03-30', 6, 'Visitors: Kevin and Roxanne Wheeler from Louisiana, on holidays in the West of Ireland\n\nAvril Away today as per text message to Alan 18.3.14\nMaddy and Carrie will help lead the singing.', 1, 0, 3, 'alan', '2014-03-29 21:08:53', NULL),
(53, '2014-04-06', 2, 'Hi Tom, I&#039;ve given the children 2 songs to learn to play for this family.\nBeautiful One EP and Jesus paid it all(I hear the Saviour say) EP. Thanks Avril \n\nHI Tom OM Ireland will be in Church they will give a report and do a Children&#039;s spot Mossy.\nThe names of the OM people are Andrea Swartzell and David and Wendy Johnston \n\nAvril, Can you play EP57 Worthy is the Lamb during the collection. Just the music will do , Thanks\n\nSat Apr 05 2014, Note from mossy:\nAn Epic Journey\nA Map of Abrams journey\nEph 2:8-9\nGen.11:31\nGen.12:1-2\nHeb.11:8\nhttp://www.youtube.com/watch?v=y6LEdItthdM\n\nSat Apr 05 2014, Note from mossy:\nMatthias', 1, 1, 3, 'Matthias', '2014-04-06 08:12:51', NULL),
(54, '2014-04-13', 3, 'Wed Apr 02 2014, Note from Phil\n&quot;Come people of the risen King&quot; to be practiced Tuesday 8th\n\nMon Apr 07 2014, Note from avril:\n`He brought me to His banqueting table is a different song to  the song Tim is talking about. I&#039;ll look for the words and music. Avril', 9, 0, 2, 'matthias', '2014-04-13 12:34:59', NULL),
(55, '2014-04-20', 4, 'Easter Sunday\n\nSat Apr 12 2014, Note from avril:\nNo Sunday school.\nRuth doing child spot.\nVerse 4 in Irish for &#039;His Banner over me is love&#039; Thanks. Avril.', 9, 0, 3, 'matthias', '2014-04-20 12:17:38', NULL),
(56, '2014-04-27', 6, 'Wed Apr 23 2014, Note from avril:\nAlan do you want the celtic tune to &#039;When I survey&#039; ? or the traditional one MP 755? Avril.\n\nFri Apr 25 2014, Note from margret:\nAlan, please could you announce on Sunday that the lady next door to the church in Mo Leanbh (the baby shop) is holding a coffee morning on Friday (2nd May) from 9.30am to 12 mid day. It is in aid of Alzheimer&#039;s. She has invited the church to please come along to support this cause. Thank you. Mgt', 8, 0, 3, 'alan', '2014-04-26 17:41:41', NULL),
