(639, '2016-01-10', 1, 'Sat Jan 09 2016, Note from mossy:\nPray for Marys Brothers Family Pat Mc Grath\n\nSat Jan 09 2016, Note from mossy:\nGod still remembers His early love for Jacob; He puts them in mind of all His lovingkindness, His goodness, His care for them. They should not return to their former condition in Egypt; Assyria should be the place of their captivity. But, however great the sin of Israel, the heart of their God cannot forsake His people: He will not destroy them; He is God, and not man; and, finally, He will place the people, trembling now and submissive, once more in their dwellings.\n', 14, 0, 1, 'mossy', '2016-01-09 21:58:28', '2'),
